import React from 'react'
import s from './Navbar.module.css'
import { NavLink, Link } from 'react-router-dom'
import Cart from '../../assets/icons/Cart'
import logo from '../../assets/logo.png'
import LightMood from '../../assets/icons/LightMood'
import DarkMood from '../../assets/icons/DarkMood';


export default function Navbar() {
    const themeToggle = document.getElementById("themeToggle");
    const body = document.body;

    themeToggle.addEventListener("change", () => {
        if (themeToggle.checked) {
            body.classList.add("dark");
        } else {
            body.classList.remove("dark");
        }
    });

    return (
        <div className={s.nav}>
            <div className={s.left_part}>
                <Link to={'/'}>
                    <img src={logo} alt='logo' />
                </Link>
                <Link to={'/categories'} className={s.nav_button}>Catalog</Link>
            </div>
            {/* <div className={s.theme}>
                <LightMood style={{display: 'none'}}/>
                <DarkMood />
            </div> */}
            <div class="container mx-auto p-4">
                <h1 class="text-3xl font-semibold">Переключатель темы</h1>
                <label class="flex items-center space-x-2 mt-4">
                    <input type="checkbox" id="themeToggle" class="form-checkbox h-6 w-6 text-indigo-500 transition duration-150 ease-in-out" />
                    <span class="text-gray-700 dark:text-gray-300">Темная тема</span>
                </label>
            </div>
            <div className={s.right_part}>
                <NavLink to={'/'}>Home page</NavLink>
                <NavLink to={'/products'}>All products</NavLink>
                <NavLink to={'/sales'}>All sales</NavLink>
                <NavLink to={'/cart'}><Cart /></NavLink>
            </div>
        </div>
    )
}
